import React, { Component } from "react";
import SearchBar from "./SearchBar";
class App extends Component {
  onKeywordSubmit = () => {};
  render() {
    return (
      <div className="ui container">
        <SearchBar onFormSubmit={this.onKeywordSubmit} />
      </div>
    );
  }
}

export default App;
